  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Great Meadows NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Great Meadows NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, a description of Refuge
  resources, and information on the management direction and Refuge administration.
  Key planning issues include: habitat and wildlife management, control of invasive
  species, hunting, management of public uses, resource protection, and infrastructure.\",\n\t\"license_title\":
